import { combineReducers } from "redux";
import humanBoardReducer from "./gameReducer";
import computerGameReducer from "./ComputerGameReducer";
import turnReducer from "./turnReducer";

export default combineReducers({
  humanBoard: humanBoardReducer,
  computerGame: computerGameReducer,
  turn: turnReducer,
});
